# find the shortest path tree from the last node 

# then for each node, try to dfs to the end on a restricted path
# note that when we dfs, we want to visit the same nodes beecause that could yield a path to the finish
# we want to sum up all the results! so we apply an LRU Cache

from math import inf 
from heapq import heappush, heappop
from collections import defaultdict
from functools import lru_cache

def countRestrictedPaths(n, edges):
    graph = defaultdict(list)
    for u,v,w in edges: 
        u = u-1
        v = v-1
        graph[u].append((w, v))
        graph[v].append((w, u))

    queue = [(0, n-1)]
    distance = [inf]*n
    distance[n-1] = 0
    while queue: 
        dist, u = heappop(queue)
        if dist != distance[u]: continue            # this is a cool line here to accomodate for the usual "visited" clause in djikstra
        for w, v in graph[u]:
            if distance[v] > w + dist:
                distance[v] = w + dist
                heappush(queue, (w + dist, v))
    
    # dfs to the end on the restricted path only if the dist[u] > dist[v]
    @lru_cache(None)
    def dfs(u):
        res = 0
        if u == n-1: 
            res +=1
            return res 
        for w, v in graph[u]:
            if distance[u] > distance[v]:
                res += dfs(v)
        return res
    res = dfs(0)
    return res % (10**9 + 7)


