# a little class that can visualize graphs
class GraphVisualization:
    def __init__(self, edges, spt):          ## edges[i] = [u, v w]
        self.visual = edges
        self.spt = spt
        self.labels = {}
        self.labelize()

    def labelize(self):
        for i in range(len(spt)):
            self.labels[i+1] = f'{i+1} - {spt[i]}'

    def visualize(self):
        G = nx.Graph()
        for u,v,w in self.visual: 
            G.add_edge(self.labels[u], self.labels[v], weight=w)
        pos = nx.spring_layout(G)
        weight_labels = nx.get_edge_attributes(G,'weight')
        nx.draw(G,pos,font_color = 'red', node_shape = 's', with_labels = True,)
        output = nx.draw_networkx_edge_labels(G,pos,edge_labels=weight_labels)
        plt.show()


